import React from 'react';
function File(props) {
    return (
        <div>

            <div>
                <div className='task-container'>
                    <div className='task-container-background' style={{ backgroundColor: 'rgb(144,238,144, 0.5)' }}>
                        <div className='task-term-container'>
                            <h2 className='task-term'>{props.name}</h2>
                        </div>
                        <div className='buttons-container'>
                            <button className='done-button' onClick={location}>Download</button>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default File;
